function generateMatrix(a,b){var c=new Array(b);for(let d=0;d<b;d++){c[d]=new Array(b);for(let e=0;e<b;e++)c[d][e]=a[b*d+e]}return c}function swapCols(a,b,c){for(let e=b+1;e<c-1;e++){if(0!=a[e][b]){for(let f=0;f<c;f++){var d=a[f][b];a[f][b]=a[f][e],a[f][e]=d}return!0}return!1}}function substractMultiply(a,b,c,d){var e=c[b][a]/c[a][a];for(j=a+1;j<d+1;j++)c[b][j]-=e*c[a][j];c[b][j]}function gauss(a,b,c){for(let d=0;d<c;d++)a[d].push(b[d]);for(let b=0;b<c;b++){if(0==a[b][b]&&!swapCols(a,b,c))return!1;for(let d=b+1;d<c;d++)substractMultiply(b,d,a,c)}X=new Array(c);for(let b=c-1;b>-1;b--){X[b]=a[b][c]/a[b][b];for(let d=b-1;d>-1;d--)a[d][c]-=a[d][b]*X[b]}return X}